import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Clientes from "./pages/Clientes";
import CadastroCliente from "./pages/CadastroCliente";
import VisualizarCliente from "./pages/VisualizarCliente";
import Comprar from "./pages/Comprar";
import CadastrarImovel from "./pages/CadastrarImovel";
import Alugar from "./pages/Alugar";

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        {/* Página inicial */}
        <Route path="/" element={<Home />} />

        {/* Rotas de clientes */}
        <Route path="/clientes" element={<Clientes />} />
        <Route path="/clientes/novo" element={<CadastroCliente />} />
        <Route path="/clientes/:id" element={<VisualizarCliente />} />

        {/* Rotas de comprar */}
        <Route path="/comprar" element={<Comprar />} />

        {/* Rotas de venda (cadastrar imóvel) */}
        <Route path="/vender" element={<CadastrarImovel />} />

        {/* Rotas de alugar */}
        <Route path="/alugar" element={<Alugar />} />
      </Routes>
    </Router>
  );
};

export default App;
